export default function GridTable() {
    const [thisListItem, setListItem] = useState(0);
    function cngBlock(n) {
        setListItem(n);
        const Atr_List = document.querySelectorAll('.grid-card-Button')
        Atr_List.forEach(element => {
            element.removeAttribute('aria-current');
        });
        Atr_List[n].setAttribute('aria-current', 'true')
    }
    return (
        <>
            <section className="grid-card-section">
                <header className="grid-card-header">
                    <ul className="grid-card-tab">
                        <li>
                            <button type="button" className="grid-card-Button" onClick={() => cngBlock(0)} aria-current="true">Popular</button>
                        </li>
                        <li>
                            <button type="button" className="grid-card-Button" onClick={() => cngBlock(1)}>Frontend</button>
                        </li>
                        <li>
                            <button type="button" className="grid-card-Button" onClick={() => cngBlock(2)}>Backend</button>
                        </li>
                        <li>
                            <button type="button" className="grid-card-Button" onClick={() => cngBlock(3)}>Fullstack</button>
                        </li>
                        <li>
                            <button type="button" className="grid-card-Button" onClick={() => cngBlock(4)}>Docs, Blogs &amp; Slides</button>
                        </li>
                        <li>
                            <button type="button" className="grid-card-Button" onClick={() => cngBlock(5)}>Creative</button>
                        </li>
                        <li>
                            <button type="button" className="grid-card-Button" onClick={() => cngBlock(6)}>Mobile &amp; VR</button>
                        </li>
                        <li>
                            <button type="button" className="grid-card-Button" onClick={() => cngBlock(7)}>Vanilla</button>
                        </li>
                        <li>
                            <button type="button" className="grid-card-Button" onClick={() => cngBlock(8)}>Native Languages</button>
                        </li>
                    </ul>
                </header>
                <div className="all_grid_wrap">
                    {ListGrid[thisListItem].map((MyLst) => {
                        return (<Link to="/" className="Link-style-Def Grid_Link_button Grid_home_BTN">
                            <div className="button_content">
                                <span className="button_logo_grid">
                                    <div className="grid_icons">{<MyLst.svgImg />}</div>
                                </span>
                                <div className="grid_button_text">
                                    <span className="GB_title">{MyLst.title}</span>
                                    <div className="GB_row_2">
                                        <span className="GB_subtitle">{MyLst.sub}</span>
                                    </div>
                                </div>
                            </div>
                        </Link>)
                    })}
                </div>
            </section>
        </>
    )
}